import React, { useState } from "react";
import { motion } from "framer-motion";

const FaceRecognitionAuth = () => {
  const [isLogin, setIsLogin] = useState(true);
  const [loading, setLoading] = useState(false);

  const handleFaceRecognition = async () => {
    setLoading(true);
    // Simulate API call for face recognition
    setTimeout(() => {
      setLoading(false);
      alert(isLogin ? "Login Successful" : "Registration Successful");
    }, 2000);
  };

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100 p-4">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="w-full max-w-md"
      >
        <Card className="p-6 shadow-lg bg-white rounded-2xl">
          <CardContent>
            <h2 className="text-2xl font-bold text-center mb-4">
              {isLogin ? "Face Login" : "Face Registration"}
            </h2>
            <div className="flex flex-col items-center gap-4">
              <Input type="text" placeholder="Enter Username" className="w-full" />
              <Button onClick={handleFaceRecognition} disabled={loading}>
                {loading ? "Processing..." : isLogin ? "Login with Face" : "Register with Face"}
              </Button>
            </div>
            <p className="text-center mt-4 text-sm">
              {isLogin ? "New user? " : "Already registered? "}
              <button
                className="text-blue-500 hover:underline"
                onClick={() => setIsLogin(!isLogin)}
              >
                {isLogin ? "Register Here" : "Login Here"}
              </button>
            </p>
          </CardContent>
        </Card>
      </motion.div>
    </div>
  );
};

export default FaceRecognitionAuth;
